function rowLimiter(e,i){$(e).each(function(){var e=$(this).height(),t=$(this).css("line-height"),s=e/(t=parseFloat(t));s=Math.round(s);var n=$(this).text().length,r=Math.floor(n/s*i-5);s>i&&$(this).text($(this).text().substr(0,r)+"...")})}$(document).ready(function(){new Swiper(".swiper-container",{slidesPerView:6,spaceBetween:30,loop:!0,loopFillGroupWithBlank:!0,pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"},breakpoints:{1200:{slidesPerView:5,spaceBetween:10},991:{slidesPerView:4,spaceBetween:20},767:{slidesPerView:3,spaceBetween:10},575:{slidesPerView:2,spaceBetween:20},375:{slidesPerView:2,spaceBetween:10}}})}),rowLimiter(".line-limit",2);